ass=\"wp-block-column\" style=\"flex-basis:25%\"><!-- wp:image {\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"https://s.w.org/images/core/5.8/architecture-01.jpg\" alt=\"Close-up, abstract view of geometric architecture.\" /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"25%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:25%\"><!-- wp:spacer {\"height\":500} -->\n<div style=\"height:500px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:spacer {\"height\":150} -->\n<div style=\"height:150px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:image {\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://s.w.org/images/core/5.8/architecture-02.jpg\" alt=\"Close-up, angled view of a window on a white building.\" /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"45%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:45%\"><!-- wp:image {\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"https://s.w.org/images/core/5.8/architecture-03.jpg\" alt=\"Close-up of the corner of a white, geometric building with both sharp points and round corners.\" /></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":285} -->\n<div style=\"height:285px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:10;O:8:\"stdClass\":7:{s:2:\"id\";i:29;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:29:\"Two columns of text and title\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:2651:\"\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>The voyage had begun, and had begun happily with a soft blue sky, and a calm sea.</strong></h2>\n\n\n\n<div class=\"wp-container-6252b2619d232 wp-block-columns\">\n<div class=\"wp-container-6252b2619cc54 wp-block-column\">\n<p style=\"font-size:18px\">They followed her on to the deck. All the smoke and the houses had disappeared, and the ship was out in a wide space of sea very fresh and clear though pale in the early light. They had left London sitting on its mud. A very thin line of shadow tapered on the horizon, scarcely thick enough to stand the burden of Paris, which nevertheless rested upon it. They were free of roads, free of mankind, and the same exhilaration at their freedom ran through them all.</p>\n</div>\n<style>.wp-container-6252b2619cc54 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619cc54 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619cc54 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619cc54 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619cc54 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style>\n\n\n<div class=\"wp-container-6252b2619cf5e wp-block-column\">\n<p style=\"font-size:18px\">The ship was making her way steadily through small waves which slapped her and then fizzled like effervescing water, leaving a little border of bubbles and foam on either side. The colourless October sky above was thinly clouded as if by the trail of wood-fire smoke, and the air was wonderfully salt and brisk. Indeed it was too cold to stand still. Mrs. Ambrose drew her arm within her husband&#8217;s, and as they moved off it could be seen from the way in which her sloping cheek turned up to his that she had something private to communicate.</p>\n</div>\n<style>.wp-container-6252b2619cf5e > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619cf5e > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619cf5e > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619cf5e > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619cf5e > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style></div>\n<style>.wp-container-6252b2619d232 {display: flex;gap: var( --wp--style--block-gap, 0.5em );flex-wrap: nowrap;align-items: center;}.wp-container-6252b2619d232 > * { margin: 0; }</style>\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:47:\"Two columns of text preceded by a long heading.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"en_US\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:1711:\"<!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":38,\"lineHeight\":\"1.4\"}}} -->\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>The voyage had begun, and had begun happily with a soft blue sky, and a calm sea.</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">They followed her on to the deck. All the smoke and the houses had disappeared, and the ship was out in a wide space of sea very fresh and clear though pale in the early light. They had left London sitting on its mud. A very thin line of shadow tapered on the horizon, scarcely thick enough to stand the burden of Paris, which nevertheless rested upon it. They were free of roads, free of mankind, and the same exhilaration at their freedom ran through them all.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">The ship was making her way steadily through small waves which slapped her and then fizzled like effervescing water, leaving a little border of bubbles and foam on either side. The colourless October sky above was thinly clouded as if by the trail of wood-fire smoke, and the air was wonderfully salt and brisk. Indeed it was too cold to stand still. Mrs. Ambrose drew her arm within her husband\'s, and as they moved off it could be seen from the way in which her sloping cheek turned up to his that she had something private to communicate.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:11;O:8:\"stdClass\":7:{s:2:\"id\";i:197;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:39:\"Two columns of text with offset heading\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:5567:\"\n<div class=\"wp-container-6252b2619f5da wp-block-group alignfull has-background\" style=\"background-color:#f2f0e9\">\n<div style=\"height:70px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-container-6252b2619e694 wp-block-columns alignwide are-vertically-aligned-center\">\n<div class=\"wp-container-6252b2619e07f wp-block-column\" style=\"flex-basis:50%\">\n<p class=\"has-text-color\" style=\"color:#000000;font-size:30px;line-height:1.1\"><strong>Oceanic Inspiration</strong></p>\n</div>\n<style>.wp-container-6252b2619e07f > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619e07f > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619e07f > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619e07f > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619e07f > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style>\n\n\n<div class=\"wp-container-6252b2619e398 wp-block-column\" style=\"flex-basis:50%\">\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#000000;color:#000000\" />\n</div>\n<style>.wp-container-6252b2619e398 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619e398 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619e398 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619e398 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619e398 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style></div>\n<style>.wp-container-6252b2619e694 {display: flex;gap: var( --wp--style--block-gap, 0.5em );flex-wrap: nowrap;align-items: center;}.wp-container-6252b2619e694 > * { margin: 0; }</style>\n\n\n<div class=\"wp-container-6252b2619f2f6 wp-block-columns alignwide\">\n<div class=\"wp-container-6252b2619e9d7 wp-block-column\"></div>\n<style>.wp-container-6252b2619e9d7 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619e9d7 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619e9d7 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619e9d7 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619e9d7 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style>\n\n\n<div class=\"wp-container-6252b2619ed27 wp-block-column\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Winding veils round their heads, the women walked on deck. They were now moving steadily down the river, passing the dark shapes of ships at anchor, and London was a swarm of lights with a pale yellow canopy drooping above it. There were the lights of the great theatres, the lights of the long streets, lights that indicated huge squares of domestic comfort, lights that hung high in air.</p>\n</div>\n<style>.wp-container-6252b2619ed27 > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619ed27 > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619ed27 > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619ed27 > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619ed27 > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style>\n\n\n<div class=\"wp-container-6252b2619f02f wp-block-column\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">No darkness would ever settle upon those lamps, as no darkness had settled upon them for hundreds of years. It seemed dreadful that the town should blaze for ever in the same spot; dreadful at least to people going away to adventure upon the sea, and beholding it as a circumscribed mound, eternally burnt, eternally scarred. From the deck of the ship the great city appeared a crouched and cowardly figure, a sedentary miser.</p>\n</div>\n<style>.wp-container-6252b2619f02f > .alignleft { float: left; margin-inline-start: 0; margin-inline-end: 2em; }.wp-container-6252b2619f02f > .alignright { float: right; margin-inline-start: 2em; margin-inline-end: 0; }.wp-container-6252b2619f02f > .aligncenter { margin-left: auto !important; margin-right: auto !important; }.wp-container-6252b2619f02f > * { margin-block-start: 0; margin-block-end: 0; }.wp-container-6252b2619f02f > * + * { margin-block-start: var( --wp--style--block-gap ); margin-block-end: 0; }</style></div>\n<style>.wp-container-6252b2619f2f6 {display: flex;gap: var( --wp--style--block-gap, 0.5em 