(1,1,'2022-02-13 16:34:28','2022-02-13 16:34:28','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2022-04-05 11:19:28','2022-04-05 11:19:28','',0,'http://localhost/?p=1',0,'post','',1),
(2,1,'2022-02-13 16:34:28','2022-02-13 16:34:28','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2022-02-13 16:34:28','2022-02-13 16:34:28','',0,'http://localhost/?page_id=2',0,'page','',0),
(3,1,'2022-02-13 16:34:28','2022-02-13 16:34:28','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2022-02-13 16:34:28','2022-02-13 16:34:28','',0,'http://localhost/?page_id=3',0,'page','',0),
(11,1,'2022-03-15 10:24:12','2022-03-15 10:24:12','<!-- wp:paragraph -->\n<p>தற்கால&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE\">இந்தியாவில்</a>&nbsp;உள்ள&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%AE%E0%AE%BF%E0%AE%B4%E0%AF%8D%E0%AE%A8%E0%AE%BE%E0%AE%9F%E0%AF%81\">தமிழ்நாடு</a>&nbsp;மண்டலம் வரலாற்றுக் காலத்துக்கு முன்பு முதல் மக்கள் வாழும் உறைவிடமாக தொடர்ந்து இருந்துவந்துள்ளது.&nbsp;<strong>தமிழ்நாட்டின் வரலாறும்</strong>&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%AE%E0%AE%BF%E0%AE%B4%E0%AE%B0%E0%AF%8D\">தமிழ் மக்களின்</a>&nbsp;நாகரீகமும் உலகின் மிகப் பழமையானவையாகும். முந்தைய&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%B4%E0%AF%88%E0%AE%AF_%E0%AE%95%E0%AE%B1%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%B2%E0%AE%AE%E0%AF%8D\">பழங்கற்காலம்</a>&nbsp;முதல் தற்காலம் வரையிலான தமிழ்நாட்டின் வரலாறு முழுவதிலும், இந்தப் பகுதியானது பல்வேறு புறக் கலாச்சாரங்களுடன் ஒருங்கிணைந்து இருந்து வந்துள்ளது. வரலாற்றில் ஒப்பீட்டளவில் குறுகிய காலப் பகுதிகளைத் தவிர்த்து, பிற காலகட்டங்களில் தமிழ்நாடு பகுதி புற ஆக்கிரமிப்புகள் எதுவுமின்றி சுதந்திரமாக இருந்து வந்துள்ளது.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>சேர, சோழ, பாண்டிய மற்றும் பல்லவ பேரரசுகளே நான்கு பண்டைய பூர்வீக தமிழ் பேரரசுகளாக இருந்தன. இவர்கள் தனித்தன்மை வாய்ந்த கலாச்சாரம் மற்றும் மொழி ஆகியவற்றைக் கொண்டு இந்தப் பகுதியை ஆட்சி செய்தனர், இதனால் உலகில் அழியாமல் வழக்கத்திலிருந்த சில பழமையான இலக்கியங்களின் வளர்ச்சி சாத்தியமானது. இவர்கள் ரோமப் பேரரசுடன் அதிகப்படியான கடல்வழி வர்த்தகத் தொடர்புகளைக் கொண்டிருந்தனர். இப்பகுதியின் தலைமைக்காக இந்த மூன்று வம்சத்தைச் சேர்ந்தவர்களும் ஒருவருக்கொருவர் தொடர்ச்சியாக போரிட்டுக் கொண்டனர். மூன்று பேரரசுகளும் பாரம்பரியமாக ஆட்சி செய்துவந்த இந்தப் பகுதியை மூன்றாம் நூற்றாண்டில் நுழைந்த களப்பிரர்கள் விரட்டியதால் இப்பகுதியின் பாரம்பரிய ஆட்சி வடிவம் மாறியது. பாண்டியர்கள் மற்றும் பல்லவர்கள் மீட்டெழுந்து களப்பிரர் ஆதிக்கத்தை முறியடித்து தங்களின் பாரம்பரிய பேரரசுகளை மீண்டும் நிலைநாட்டினர். வீழ்ந்திருந்த சோழர்கள் ஒன்பதாம் நூற்றாண்டில் பல்லவர்களையும் பாண்டியர்களையும் தோற்கடித்து, தங்களது பெரும் சக்தியாக எழுச்சியடைந்து கிட்டத்தட்ட தெற்கு தீபகற்பப் பகுதி முழுவதும் தங்கள் பேரரசை விரிவுபடுத்தினர்.&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%B3_%E0%AE%B5%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%95%E0%AF%81%E0%AE%9F%E0%AE%BE\">வங்காள விரிகுடா</a>&nbsp;பகுதியில் சோழப் பேரரசு சுமார் 3,600,000 கி.மீ2 அளவிற்குப் பரவி இருந்தது.&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%9A%E0%AE%BF%E0%AE%AF%E0%AE%BE\">தென்கிழக்கு ஆசியாவில்</a>&nbsp;இருந்த ஸ்ரீ விஜயா பேரரசு பகுதியையும் சோழரின் கடற்படை கட்டுப்பாட்டில் கொண்டிருந்தது.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>வடமேற்கு பகுதியிலிருந்து வந்த&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AE%E0%AF%80%E0%AE%A4%E0%AE%BE%E0%AE%A9_%E0%AE%87%E0%AE%9A%E0%AF%81%E0%AE%B2%E0%AE%BE%E0%AE%AE%E0%AE%BF%E0%AE%AF%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AE%9F%E0%AF%88%E0%AE%AF%E0%AF%86%E0%AE%9F%E0%AF%81%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%81\">இசுலாமிய படைகளின் ஊடுருவல்</a>&nbsp;காரணமாக இந்தியாவின் மற்ற பகுதிகளில் ஏற்பட்ட அரசியல் மாற்றங்கள் தமிழ்நாட்டின் வரலாற்றில் குறிப்பிடத்தக்க மாற்றம் ஏற்பட்டது. பதினான்காம் நூற்றாண்டில் பண்டைய மூன்று பேரரசுகளின் வீழ்ச்சி காரணமாக, தமிழ்நாடு&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%9C%E0%AE%AF%E0%AE%A8%E0%AE%95%E0%AE%B0%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%B0%E0%AE%B0%E0%AE%9A%E0%AF%81\">விஜயநகரப் பேரரசின்</a>&nbsp;ஒரு அங்கமாக மாறியது. விஜயநகரப் பேரரசின் கீழ்&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%86%E0%AE%B2%E0%AF%81%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AF%81\">தெலுங்கு</a>&nbsp;பேசும் நாயக்கர் ஆட்சியாளர்கள் தமிழ்ப் பகுதியை ஆட்சி செய்தனர். மராத்தியர்களின் குறுகிய கால வருகை தமிழ்ப் பகுதியில்&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%BE%E0%AE%A9%E0%AE%BF%E0%AE%AF%E0%AE%95%E0%AF%8D_%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%95%E0%AF%8D_%E0%AE%95%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AE%A9%E0%AE%BF\">ஐரோப்பிய வணிக நிறுவனங்களின்</a>&nbsp;வருகைக்கு வழிவகுத்தது. பதினேழாம் நூற்றாண்டின் போது இவ்வாறு வணிகம் செய்ய வந்தவர்கள் இறுதியில் இந்தப் பகுதியின் பூர்வீக ஆட்சியாளர்களை தங்களின் கட்டுப்பாட்டின் கீழ்க் கொண்டுவந்தனர். தென்னிந்தியாவின் பல பகுதிகளை உள்ளடக்கிய&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%A9%E0%AF%88_%E0%AE%AE%E0%AE%BE%E0%AE%95%E0%AE%BE%E0%AE%A3%E0%AE%AE%E0%AF%8D\">சென்னை மாகாணம்</a>&nbsp;பதினெட்டாம் நூற்றாண்டில் உருவாக்கப்பட்டது. இப்பகுதி பிரித்தானியக் கிழக்கிந்தியக் கம்பனியால் நேரடியாக ஆட்சி செய்யப்பட்டது. இந்தியாவின் சுதந்திரத்திற்குப் பிறகு மொழியியல் எல்லைகளை அடிப்படையாகக் கொண்டு தமிழ்நாடு மாநிலம் உருவாக்கப்பட்டது.</p>\n<!-- /wp:paragraph -->','தமிழக வரலாறு','','publish','open','open','','%e0%ae%a4%e0%ae%ae%e0%ae%bf%e0%ae%b4%e0%ae%95-%e0%ae%b5%e0%ae%b0%e0%ae%b2%e0%ae%be%e0%ae%b1%e0%af%81','','','2022-04-05 11:19:21','2022-04-05 11:19:21','',0,'http://localhost/?p=11',0,'post','',1),
(12,1,'2022-03-15 10:23:36','2022-03-15 10:23:36','{\"version\": 2, \"isGlobalStylesUserThemeJSON\": true }','Custom Styles','','publish','closed','closed','','wp-global-styles-news-way','','','2022-03-15 10:23:36','2022-03-15 10:23:36','',0,'http://localhost/2022/03/15/wp-global-styles-news-way/',0,'wp_global_styles','',0),
(13,1,'2022-03-15 10:24:01','2022-03-15 10:24:01','<!-- wp:paragraph -->\n<p>தற்கால&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE\">இந்தியாவில்</a>&nbsp;உள்ள&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%AE%E0%AE%BF%E0%AE%B4%E0%AF%8D%E0%AE%A8%E0%AE%BE%E0%AE%9F%E0%AF%81\">தமிழ்நாடு</a>&nbsp;மண்டலம் வரலாற்றுக் காலத்துக்கு முன்பு முதல் மக்கள் வாழும் உறைவிடமாக தொடர்ந்து இருந்துவந்துள்ளது.&nbsp;<strong>தமிழ்நாட்டின் வரலாறும்</strong>&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%AE%E0%AE%BF%E0%AE%B4%E0%AE%B0%E0%AF%8D\">தமிழ் மக்களின்</a>&nbsp;நாகரீகமும் உலகின் மிகப் பழமையானவையாகும். முந்தைய&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%B4%E0%AF%88%E0%AE%AF_%E0%AE%95%E0%AE%B1%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%B2%E0%AE%AE%E0%AF%8D\">பழங்கற்காலம்</a>&nbsp;முதல் தற்காலம் வரையிலான தமிழ்நாட்டின் வரலாறு முழுவதிலும், இந்தப் பகுதியானது பல்வேறு புறக் கலாச்சாரங்களுடன் ஒருங்கிணைந்து இருந்து வந்துள்ளது. வரலாற்றில் ஒப்பீட்டளவில் குறுகிய காலப் பகுதிகளைத் தவிர்த்து, பிற காலகட்டங்களில் தமிழ்நாடு பகுதி புற ஆக்கிரமிப்புகள் எதுவுமின்றி சுதந்திரமாக இருந்து வந்துள்ளது.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>சேர, சோழ, பாண்டிய மற்றும் பல்லவ பேரரசுகளே நான்கு பண்டைய பூர்வீக தமிழ் பேரரசுகளாக இருந்தன. இவர்கள் தனித்தன்மை வாய்ந்த கலாச்சாரம் மற்றும் மொழி ஆகியவற்றைக் கொண்டு இந்தப் பகுதியை ஆட்சி செய்தனர், இதனால் உலகில் அழியாமல் வழக்கத்திலிருந்த சில பழமையான இலக்கியங்களின் வளர்ச்சி சாத்தியமானது. இவர்கள் ரோமப் பேரரசுடன் அதிகப்படியான கடல்வழி வர்த்தகத் தொடர்புகளைக் கொண்டிருந்தனர். இப்பகுதியின் தலைமைக்காக இந்த மூன்று வம்சத்தைச் சேர்ந்தவர்களும் ஒருவருக்கொருவர் தொடர்ச்சியாக போரிட்டுக் கொண்டனர். மூன்று பேரரசுகளும் பாரம்பரியமாக ஆட்சி செய்துவந்த இந்தப் பகுதியை மூன்றாம் நூற்றாண்டில் நுழைந்த களப்பிரர்கள் விரட்டியதால் இப்பகுதியின் பாரம்பரிய ஆட்சி வடிவம் மாறியது. பாண்டியர்கள் மற்றும் பல்லவர்கள் மீட்டெழுந்து களப்பிரர் ஆதிக்கத்தை முறியடித்து தங்களின் பாரம்பரிய பேரரசுகளை மீண்டும் நிலைநாட்டினர். வீழ்ந்திருந்த சோழர்கள் ஒன்பதாம் நூற்றாண்டில் பல்லவர்களையும் பாண்டியர்களையும் தோற்கடித்து, தங்களது பெரும் சக்தியாக எழுச்சியடைந்து கிட்டத்தட்ட தெற்கு தீபகற்பப் பகுதி முழுவதும் தங்கள் பேரரசை விரிவுபடுத்தினர்.&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%B3_%E0%AE%B5%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%95%E0%AF%81%E0%AE%9F%E0%AE%BE\">வங்காள விரிகுடா</a>&nbsp;பகுதியில் சோழப் பேரரசு சுமார் 3,600,000 கி.மீ2 அளவிற்குப் பரவி இருந்தது.&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%9A%E0%AE%BF%E0%AE%AF%E0%AE%BE\">தென்கிழக்கு ஆசியாவில்</a>&nbsp;இருந்த ஸ்ரீ விஜயா பேரரசு பகுதியையும் சோழரின் கடற்படை கட்டுப்பாட்டில் கொண்டிருந்தது.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>வடமேற்கு பகுதியிலிருந்து வந்த&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AE%E0%AF%80%E0%AE%A4%E0%AE%BE%E0%AE%A9_%E0%AE%87%E0%AE%9A%E0%AF%81%E0%AE%B2%E0%AE%BE%E0%AE%AE%E0%AE%BF%E0%AE%AF%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AE%9F%E0%AF%88%E0%AE%AF%E0%AF%86%E0%AE%9F%E0%AF%81%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%81\">இசுலாமிய படைகளின் ஊடுருவல்</a>&nbsp;காரணமாக இந்தியாவின் மற்ற பகுதிகளில் ஏற்பட்ட அரசியல் மாற்றங்கள் தமிழ்நாட்டின் வரலாற்றில் குறிப்பிடத்தக்க மாற்றம் ஏற்பட்டது. பதினான்காம் நூற்றாண்டில் பண்டைய மூன்று பேரரசுகளின் வீழ்ச்சி காரணமாக, தமிழ்நாடு&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%9C%E0%AE%AF%E0%AE%A8%E0%AE%95%E0%AE%B0%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%B0%E0%AE%B0%E0%AE%9A%E0%AF%81\">விஜயநகரப் பேரரசின்</a>&nbsp;ஒரு அங்கமாக மாறியது. விஜயநகரப் பேரரசின் கீழ்&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%86%E0%AE%B2%E0%AF%81%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AF%81\">தெலுங்கு</a>&nbsp;பேசும் நாயக்கர் ஆட்சியாளர்கள் தமிழ்ப் பகுதியை ஆட்சி செய்தனர். மராத்தியர்களின் குறுகிய கால வருகை தமிழ்ப் பகுதியில்&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AE%BF%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%BE%E0%AE%A9%E0%AE%BF%E0%AE%AF%E0%AE%95%E0%AF%8D_%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%95%E0%AF%8D_%E0%AE%95%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AE%A9%E0%AE%BF\">ஐரோப்பிய வணிக நிறுவனங்களின்</a>&nbsp;வருகைக்கு வழிவகுத்தது. பதினேழாம் நூற்றாண்டின் போது இவ்வாறு வணிகம் செய்ய வந்தவர்கள் இறுதியில் இந்தப் பகுதியின் பூர்வீக ஆட்சியாளர்களை தங்களின் கட்டுப்பாட்டின் கீழ்க் கொண்டுவந்தனர். தென்னிந்தியாவின் பல பகுதிகளை உள்ளடக்கிய&nbsp;<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%A9%E0%AF%88_%E0%AE%AE%E0%AE%BE%E0%AE%95%E0%AE%BE%E0%AE%A3%E0%AE%AE%E0%AF%8D\">சென்னை மாகாணம்</a>&nbsp;பதினெட்டாம் நூற்றாண்டில் உருவாக்கப்பட்டது. இப்பகுதி பிரித்தானியக் கிழக்கிந்தியக் கம்பனியால் நேரடியாக ஆட்சி செய்யப்பட்டது. இந்தியாவின் சுதந்திரத்திற்குப் பிறகு மொழியியல் எல்லைகளை அடிப்படையாகக் கொண்டு தமிழ்நாடு மாநிலம் உருவாக்கப்பட்டது.</p>\n<!-- /wp:paragraph -->','தமிழக வரலாறு','','inherit','closed','closed','','11-revision-v1','','','2022-03-15 10:24:01','2022-03-15 10:24:01','',11,'http://localhost/?p=13',0,'revision','',0),
(14,1,'2022-03-15 10:29:09','2022-03-15 10:29:09','<!-- wp:paragraph -->\n<p>இதற்கு மொழிபெயர்த்து உதவவும். நன்றி. --<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D:AntanO\">Anton</a><a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:AntanO\"><sup>Talk</sup></a>&nbsp;19:26, 3 சனவரி 2015 (UTC)[<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%80%E0%AE%9F%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:File_Upload_Wizard\">பதில் அளி</a>]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>படிமம் பதிவேற்றும் கருவி</strong>&nbsp;அல்லது&nbsp;<strong>படிமத்தை பதிவேற்றும் கருவி</strong>&nbsp;அல்லது&nbsp;<strong>படிமம் பதிவேற்றும் பொறி</strong>&nbsp;அல்லது&nbsp;<strong>படிமத்தை பதிவேற்றும் பொறி</strong>--<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D:Kurumban\">குறும்பன்</a>&nbsp;(<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:Kurumban\">பேச்சு</a>) 19:42, 3 சனவரி 2015 (UTC)[<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%80%E0%AE%9F%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:File_Upload_Wizard\">பதில் அளி</a>]<em>விக்கிப்பீடியா:File Upload Wizard</em>&nbsp;என்பது&nbsp;<em>சிறப்பு:Upload</em>&nbsp;போன்று செயற்பாட்டுக் கட்டளைகளை நிறைவேற்ற அபப்படியே இருக்கட்டும். உங்கள் பரிந்துரையை விளக்கத்திற்குப் பயன்படுத்தலாம். --<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D:AntanO\">Anton</a><a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:AntanO\"><sup>Talk</sup></a>&nbsp;19:48, 3 சனவரி 2015 (UTC)[<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%80%E0%AE%9F%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:File_Upload_Wizard\">பதில் அளி</a>]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>வணக்கம். சில நாள்களாக படத்தை File Upload Wizard மூலமாகப் பதிவேற்ற முயற்சிக்கிறேன். ஆனால் முடியவில்லை. அடுத்த நிலைக்குச் (Next stage does not open) செல்ல முடியவில்லை.--<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D:%E0%AE%AA%E0%AE%BE.%E0%AE%9C%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AF%81%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D\">பா.ஜம்புலிங்கம்</a>&nbsp;(<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:%E0%AE%AA%E0%AE%BE.%E0%AE%9C%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AF%81%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D\">பேச்சு</a>) 15:27, 10 சூலை 2015 (UTC)[<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%80%E0%AE%9F%E0%AE%BF%E0%AE%AF%E0%AE%BE_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:File_Upload_Wizard\">பதில் அளி</a>]சாதாரண வழிகாட்டியைப் பயன்படுத்தினேன். சரியாகிவிட்டது.--<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D:%E0%AE%AA%E0%AE%BE.%E0%AE%9C%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AF%81%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D\">பா.ஜம்புலிங்கம்</a>&nbsp;(<a href=\"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%A9%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81:%E0%AE%AA%E0%AE%BE.%E0%AE%9C%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AF%81%E0%AE%B2%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D\">பேச்சு</a>) 16:27, 10 சூலை 2015 (UTC)</p>\n<!-- /wp:paragraph -->','விக்கிப்பீடியா பேச்சு','','publish','op