(39,1,'2022-03-22 13:36:59','2022-03-22 13:36:59','<!-- wp:paragraph -->\n<p>டெல்லி : இன்னும் இரண்டு வருடங்களில் பெட்ரோல் கார்களின் விலைக்கே எலக்ட்ரிக் கார்களும் கிடைக்கும் எனவும், 2024ஆம் ஆண்டு டிசம்பர் மாதத்திற்கு முன் இந்தியாவின் சாலை கட்டமைப்பு அமெரிக்காவை போல் இருக்கும் என்று உறுதியளிப்பதாக நெடுஞ்சாலை துறை அமைச்சர் நிதின் கட்கரி கூறியுள்ளார்</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>இந்தியாவில் காற்று மாசுபாட்டைக் குறைக்கும் பொருட்டு பல்வேறு நடவடிக்கைகள் எடுக்கப்பட்டு வருகின்றன. அந்தவகையில், மின் வாகன பயன்பாட்டை ஊக்குவிக்கும் முயற்சிகள் மேற்கொள்ளப்பட்டு வருகின்றன.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>ஆனால் அதிகளவு சிலை, பராமரிப்பு, சர்வீஸ் செண்டர்கள், சார்ஜிங் மையங்கள் இல்லாததது உள்ளிட்ட நடைமுறை சிக்கல்கள் உள்ள நிலையில், இந்தியாவில் எலெட்ரிக் கார்கள் மற்றும் இருசக்கர வாகனங்களின் பயன்பாடு பெட்ரோல், டீசல் வாகனங்களை விட குறைவாகவே உள்ளது.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":40,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/wp-content/uploads/2022/03/image.png\" alt=\"\" class=\"wp-image-40\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2>அமைச்சர் நிதின் கட்கரி</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>இந்நிலையில் இன்னும் இரண்டு வருடங்களில் பெட்ரோல் கார்களின் விலைக்கே எலக்ட்ரிக் கார்களும் கிடைக்கும் எனவும், 2024ஆம் ஆண்டு டிசம்பர் மாதத்திற்கு முன் இந்தியாவின் சாலை கட்டமைப்பு அமெரிக்காவை போல் இருக்கும் என்று உறுதியளிப்பதாக நெடுஞ்சாலை துறை அமைச்சர் நிதின் கட்கரி கூறியுள்ளார். 2022-23ஆம் ஆண்டுக்கான சாலைப் போக்குவரத்து மற்றும் நெடுஞ்சாலை அமைச்சகத்திற்கான மானிய கோரிக்கைகள் குறித்து மக்களவையில் பதிலளித்த கட்கரி, விலை குறைந்த உள்நாட்டு எரிபொருளுக்கு மாற வேண்டியதன் அவசியத்தை சுட்டிக்காட்டியதோடு, இந்த எரிபொருள் விரைவில் நடைமுறைக்கு வரும் என்றும், மாசு அளவைக் குறைக்கும் என்றும் கூறினார்.</p>\n<!-- /wp:paragraph -->','இன்னும் ரெண்டே வருஷம் தான்.. அமெரிக்காவுக்கு இணையா ரோடு.. பெட்ரோல் கார் விலையில் எலக்ட்ரிக் கார்..!','','publish','open','open','','%e0%ae%87%e0%ae%a9%e0%af%8d%e0%ae%a9%e0%af%81%e0%ae%ae%e0%af%8d-%e0%ae%b0%e0%af%86%e0%ae%a3%e0%af%8d%e0%ae%9f%e0%af%87-%e0%ae%b5%e0%ae%b0%e0%af%81%e0%ae%b7%e0%ae%ae%e0%af%8d-%e0%ae%a4%e0%ae%be','','','2022-04-05 11:18:53','2022-04-05 11:18:53','',0,'http://localhost/?p=39',0,'post','',0),
